  return (
    <BlueContainer>
      <div>
        <h1>A lifetime of discounts? It's Genius.</h1>
        <p>
          Get rewarded for your travels - unlock instant savings of 10% or more
          with a free account
        </p>
        <button>Sign in / Registter</button>
      </div>
      <div>
        <input></input>
      </div>
    </BlueContainer>
  );
};

export default Header;
